import React from 'react';
import {Link, NavLink} from 'react-router-dom';

export const Navbar = () => {
    return (
        <div className="navbar navbar-dark bg-dark">
            <Link className="navbar-brand" to="/">AUTH</Link>
        </div>
    )
}
